package com.class11;

public class HW5SwapNums {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x=10,y=25;
		System.out.println("x="+x);
		System.out.println("y="+y);
		x=x+y;
		y=x-y;
		x=x-y;
		System.out.println("x1="+x);
		System.out.println("y1="+y);
	}

}
